$(document).ready(()=>{$.get("/api/user_data").then(a=>{$("#name").val(a.firstName),$("#age").val(a.age)}),$.get("/api/walking").then(a=>{console.log(a),$("#goal").append(a[a.length-1].goal),$("#duration").append(a[a.length-1].duration),$("#miles").append(a[a.length-1].miles),$("#steps").append(a[a.length-1].steps)})});